import React from 'react';
import { BoardList } from '../components';
import { connect } from 'react-redux';
import { bindActionCreators } from '../../../../../Users/neurophet/AppData/Local/Microsoft/TypeScript/3.6/node_modules/redux';

class Board extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      memberList: []
    };
  }

  // componentDidMount() {
  //   this._getList();
  // }

  // _getList() {
  //   const apiUrl = '../store/modules/member.js';

  //   axios.get(apiUrl).then(data => {
  //     this.setState({
  //       member : data.data.member
  //     });
  //   })
  //   .catch(error => {
  //     console.log(error);
  //   })
  // }

  componentDidMount() {
    fetch('http://localhost:3000/store/modules/member')
      .then(res => res.json())
      .then(data => this.setState({ data }));
  }

  render() {
    const { member } = this.props;

    return(
      <div>
        <BoardList member={member} />
      </div>
    );
  }
}

export default connect(
  (state) => ({
    member: state.member
  }),
  (dispatch) => ({
    MemberActions: bindActionCreators(memberActions, dispatch)
  })
)(Board);
